"use strict";function togglePrices(e){var t=document.getElementById("plansWrapper");t.classList.contains(e)||(t.classList.remove("yearly-price"===e?"monthly-price":"yearly-price"),t.classList.add(e))}const pricesControl=document.getElementById("pricesControl");pricesControl.addEventListener("click",e=>{e=e.target.dataset.ctaPlans;e&&togglePrices(e)});